PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "action_time" datetime NOT NULL, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0));
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "first_name" varchar(30) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "last_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "app_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "fname" varchar(40) NOT NULL, "lname" varchar(50) NOT NULL, "user_name" varchar(80) NOT NULL UNIQUE, "user_address" varchar(200) NOT NULL, "password" varchar(16) NOT NULL);
CREATE TABLE IF NOT EXISTS "app_manto" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "how_close" varchar(30) NOT NULL, "belt" varchar(20) NOT NULL, "clothes_id" integer NOT NULL UNIQUE REFERENCES "app_clothes" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "app_pants" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "model" varchar(20) NOT NULL, "clothes_id" integer NOT NULL UNIQUE REFERENCES "app_clothes" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "app_ball" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "size" integer NOT NULL, "weight" integer NOT NULL, "sport_id" integer NOT NULL UNIQUE REFERENCES "app_sport" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "app_blouse" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "collar" varchar(20) NOT NULL, "clothes_id" integer NOT NULL UNIQUE REFERENCES "app_clothes" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "app_crayons" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "num" integer NOT NULL, "stationery_id" integer NOT NULL UNIQUE REFERENCES "app_stationery" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "app_eraser" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "weight" integer NOT NULL, "stationery_id" integer NOT NULL UNIQUE REFERENCES "app_stationery" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "app_notebook" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "num_pages" integer NOT NULL, "stationery_id" integer NOT NULL UNIQUE REFERENCES "app_stationery" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "app_sofa" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "bodyMaterial" varchar(20) NOT NULL, "coverMaterial" varchar(20) NOT NULL, "homeAppliances_id" integer NOT NULL UNIQUE REFERENCES "app_homeappliances" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "app_comment" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "text" text NOT NULL, "name" varchar(30) NOT NULL, "date" datetime NOT NULL, "good_id" integer NOT NULL REFERENCES "app_good" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "app_bicycle" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "size" integer NOT NULL, "sport_id" integer NOT NULL UNIQUE REFERENCES "app_sport" ("id") DEFERRABLE INITIALLY DEFERRED, "weight" integer NOT NULL);
CREATE TABLE IF NOT EXISTS "app_treadmill" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "max_weight" integer NOT NULL, "sport_id" integer NOT NULL UNIQUE REFERENCES "app_sport" ("id") DEFERRABLE INITIALLY DEFERRED, "self_weight" integer NOT NULL);
CREATE TABLE IF NOT EXISTS "app_homeappliances" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "good_id" integer NOT NULL UNIQUE REFERENCES "app_good" ("id") DEFERRABLE INITIALLY DEFERRED, "category_happ" varchar(20) NOT NULL);
CREATE TABLE IF NOT EXISTS "app_pen" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "stationery_id" integer NOT NULL UNIQUE REFERENCES "app_stationery" ("id") DEFERRABLE INITIALLY DEFERRED, "color" varchar(20) NOT NULL);
CREATE TABLE IF NOT EXISTS "app_refrigerator" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "height" integer NOT NULL, "deep" integer NOT NULL, "homeAppliances_id" integer NOT NULL UNIQUE REFERENCES "app_homeappliances" ("id") DEFERRABLE INITIALLY DEFERRED, "brand" varchar(20) NOT NULL);
CREATE TABLE IF NOT EXISTS "app_sport" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "good_id" integer NOT NULL UNIQUE REFERENCES "app_good" ("id") DEFERRABLE INITIALLY DEFERRED, "category_sport" varchar(20) NOT NULL);
CREATE TABLE IF NOT EXISTS "app_stationery" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "good_id" integer NOT NULL UNIQUE REFERENCES "app_good" ("id") DEFERRABLE INITIALLY DEFERRED, "category_st" varchar(20) NOT NULL);
CREATE TABLE IF NOT EXISTS "app_tv" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "size" integer NOT NULL, "bluetooth" bool NOT NULL, "homeAppliances_id" integer NOT NULL UNIQUE REFERENCES "app_homeappliances" ("id") DEFERRABLE INITIALLY DEFERRED, "brand" varchar(20) NOT NULL);
CREATE TABLE IF NOT EXISTS "app_washing_machine" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "height" integer NOT NULL, "capacity" integer NOT NULL, "homeAppliances_id" integer NOT NULL UNIQUE REFERENCES "app_homeappliances" ("id") DEFERRABLE INITIALLY DEFERRED, "brand" varchar(20) NOT NULL);
CREATE TABLE IF NOT EXISTS "app_electronic" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "weight" real NOT NULL, "good_id" integer NOT NULL UNIQUE REFERENCES "app_good" ("id") DEFERRABLE INITIALLY DEFERRED, "category_elec" varchar(20) NOT NULL, "brand" varchar(20) NOT NULL);
CREATE TABLE IF NOT EXISTS "app_image" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "good_id" integer NOT NULL REFERENCES "app_good" ("id") DEFERRABLE INITIALLY DEFERRED, "img_src" varchar(200) NOT NULL);
CREATE TABLE IF NOT EXISTS "app_clothes" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "type" varchar(100) NOT NULL, "good_id" integer NOT NULL UNIQUE REFERENCES "app_good" ("id") DEFERRABLE INITIALLY DEFERRED, "category_clothes" varchar(20) NOT NULL, "gender" varchar(20) NOT NULL, "size_this" varchar(10) NOT NULL);
CREATE TABLE IF NOT EXISTS "app_color" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "color" varchar(20) NOT NULL, "electronic_id" integer NOT NULL REFERENCES "app_electronic" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "app_headset" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "led_indicator" bool NOT NULL, "connectionType" varchar(20) NOT NULL, "electronic_id" integer NOT NULL UNIQUE REFERENCES "app_electronic" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "app_products_id" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "cart_id" integer NOT NULL REFERENCES "app_cart" ("id") DEFERRABLE INITIALLY DEFERRED, "interesting_id" integer NOT NULL REFERENCES "app_interesting" ("id") DEFERRABLE INITIALLY DEFERRED, "key" integer NOT NULL);
CREATE TABLE IF NOT EXISTS "app_location" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "state" varchar(256) NOT NULL, "city" varchar(256) NOT NULL, "address" text NOT NULL, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "postal_code" varchar(256) NOT NULL);
CREATE TABLE IF NOT EXISTS "app_user_img" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL UNIQUE REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "image" varchar(100) NULL);
CREATE TABLE IF NOT EXISTS "app_discount_code" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "code" varchar(40) NOT NULL);
CREATE TABLE IF NOT EXISTS "app_good" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL, "real_price" integer NOT NULL, "num" integer NOT NULL, "discount" integer NOT NULL, "release_date" datetime NOT NULL, "score" real NOT NULL, "score_num" integer NOT NULL, "category" varchar(20) NOT NULL, "price" integer NOT NULL);
CREATE TABLE IF NOT EXISTS "app_cart" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "number" integer NOT NULL, "good_id" integer NULL REFERENCES "app_good" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "app_interesting" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "good_id" integer NULL REFERENCES "app_good" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "app_laptop" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "storage" integer NOT NULL, "ram" integer NOT NULL, "color_this" varchar(20) NOT NULL, "electronic_id" integer NOT NULL UNIQUE REFERENCES "app_electronic" ("id") DEFERRABLE INITIALLY DEFERRED, "color_choose" varchar(20) NULL);
CREATE TABLE IF NOT EXISTS "app_mobile" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "memory" integer NOT NULL, "ram" integer NOT NULL, "color_this" varchar(20) NOT NULL, "electronic_id" integer NOT NULL UNIQUE REFERENCES "app_electronic" ("id") DEFERRABLE INITIALLY DEFERRED, "color_choose" varchar(20) NULL);
CREATE TABLE IF NOT EXISTS "app_shirt" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "sleeve_height" varchar(20) NOT NULL, "clothes_id" integer NOT NULL UNIQUE REFERENCES "app_clothes" ("id") DEFERRABLE INITIALLY DEFERRED, "size_this" varchar(20) NULL);
CREATE TABLE IF NOT EXISTS "app_tshirt" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "collar" varchar(20) NOT NULL, "clothes_id" integer NOT NULL UNIQUE REFERENCES "app_clothes" ("id") DEFERRABLE INITIALLY DEFERRED, "size_this" varchar(20) NULL);
CREATE TABLE IF NOT EXISTS "app_charger" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "cable_type" varchar(20) NOT NULL, "electronic_id" integer NOT NULL UNIQUE REFERENCES "app_electronic" ("id") DEFERRABLE INITIALLY DEFERRED, "usb_num" integer NOT NULL);
CREATE TABLE IF NOT EXISTS "app_size" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "clothes_id" integer NOT NULL REFERENCES "app_clothes" ("id") DEFERRABLE INITIALLY DEFERRED, "size" varchar(10) NOT NULL);
